INSERT INTO `model` VALUES (1,1,'Siddhartha Dhar Choudhury','Sentiment Analysis','<p>Sentiment Analysis is the domain of understanding the emotions with software, and it’s a must-understand for developers and business leaders in a modern workplace.</p>\n<p>Today we use natural language processing, statistics, and text analysis to extract, and identify the sentiment of text into positive, negative, or neutral categories with the help of cutting-edge algorithms.</p>\n<p>Uses:- </p>\n<ul>\n<li>Sentiment Analysis for Brand Monitoring ->\nWidely available media, like product reviews and social, can reveal key insights about what your business is doing right or wrong.</li>\n<li>Sentiment Analysis for Customer Service ->\nCustomer service agents often use sentiment or intent analysis to automatically sort incoming user email into “urgent” or “not urgent” buckets based on the sentiment of the email, proactively identifying frustrated users. </li>\n<li>Sentiment Analysis for Market Research and Analysis ->\nIn business intelligence application to understand the subjective reasons why consumers are or are not buying a product? What do they think of the user experience? Did customer service support meet their expectations? </li>\n</ul>\n<br>\n<p>Model Characteristics :- </p>\n<ul>\n<li>Trained using scikit-learn</li>\n<li>Technologies used - Naive Bayes, Bag of Words</li>\n<li>Dataset used - Imdb movie Review dataset</li>\n</ul>','https://storage.googleapis.com/tensorflow/tf-keras-datasets/imdb.npz','code4dff4ea340f0a823f15d3f4f01ab62eae0e5da579ccb851f8db9dfe84c58b2b37b89903a740e1ee172da793a6e79d560e5f7f9bd058a12a280433ed6fa46510a.zip','model4dff4ea340f0a823f15d3f4f01ab62eae0e5da579ccb851f8db9dfe84c58b2b37b89903a740e1ee172da793a6e79d560e5f7f9bd058a12a280433ed6fa46510a.zip',1,'2019-11-04 05:59:42');
/*!40000 ALTER TABLE `model` ENABLE KEYS */;
